  The Third Reunion
  The 175th anniversary of the
  establishment of the Wiliams Family in
  New Zealand was marked by a family
  reunion held at Paihia over the weekend
  of 16 - 19 April 1998. Some 800 family
  members gathered from throughout New
  Zealand and around the world to renew
  old acquantances and make new ones, to
  reminisce and to look forward to the
  future. The venue was the Copthorne
  Resort Hotel at Waitangi where a huge tent
  Si
  was erected on the lawn to serve as the
  locale for many of the activities. These
  included a welcome onto the Waitangi
  Marae and a pageant depicting the arrival
  Photo from: Brian Morgan, Paihia Photography
  of Henry and Marianne Williams at Paihia
  in 1823. There were sporting contests for
  Descendants of both Henry and William paddle the waka during the re-enactment
  those with energy to spare, and mountains
  of the landing at Paihia during the 1998 family reunion.
  of food for the multitude, Locations
  relating to the history of the family were
  visited by coach tours and cruises and the
  spiritual heritage of the family was evident
  in the large attendance at the church
  services held each day. A highlight of the
  proceedings was a seminar held to explore
  the significance of the family's
  contribution to the history of New
  Zealand.
  The Right Reverend Bishop John
  Patterson, Anglican Bishop of Auckland,
  and a student of our early history, led the
  panel with a review of the lives of Henry
  and William both before and after their
  arrival in New Zealand. He was followed
  by Rev Jacob Huranga Hakaria, Anglican
  Priest, who grew up in nearby Ngawha
  Photo from: Brian Morgan, Paihia Photography
