  and is currently writing a Maori history
  of pre-Treaty days. Next was the Right
  Reed and Bishop Ben Te Haara (hat right) led the family onto the Waitangi
  Reverend Bishop Ben Te Haara, Tai
  National Marae,
  Tokerau Maori Bishop, who grew up in
  Paihia and is descended from Te Koki, the
  original chief of the area. Te Koki and
  his chieftainess, Ana Hamu, placed Henry
  TER
  and Marianne on Paihia soil. Rev Joan
  Cook, Anglican Vicar of Whangarei, used
  - the audience to demonstrate aspects of the
  Treaty of Waitangi as seen by the majority
  partner and by various minority groups.
  Rev Peter Sykes, Anglican Vicar of
  Mangere and a family member who helped
  organise the discussion, provided
  inspiration to the younger members of the
  family to continue the family tradition of
  service into the new millennium. The
  session ended with comments from the
  floor, many of them providing food for
  thought, as well as resounding calls to
  action, on issues of the day.
